import React from 'react';
import { Route } from 'react-router-dom';

import './App.css';
import Homepage from './pages/homepage/homepage.component.jsx'

const HatsPage = () => {
  <div>
    <h1>HATS PAGE</h1>
  </div>
}

function App() {
  return (
    <div>
        <Route exact path='/' component={Homepage} />
        <Route path='/hats' component={HatsPage} />
      <Homepage />
    </div>
  );
}

export default App;
